description:
'Judy Tunafish'

Adam's Apple Distributing Co., 1973, 28 pages

Written and Illustrated by George Hansen

As the title implies, this one contains mostly Judy Tunafish stories. Not quite as great as some of his other books, but still work checking out, and certainly one you'd want to keep if you're a completist like me.


